import React from 'react';
import './Home.css';
import { Upload, Check } from '../../component';
import { Switch, Route } from 'react-router-dom';

const Home = () => {
    return (
        <div className="container">
            <Switch>
                <Route path="/" component={Upload} />
                <Route path="/uploads" component={Check} />
            </Switch>
        </div>
    )
}

export default Home;
